A ServiceCollection is a mutable container of ServiceDescriptor instances that you can modify before creating an immutable ServiceProvider . The ServiceCollection allows you to register or modify services in any order. When you're ready to create a ServiceProvider , the ServiceCollection will validate all service dependencies before constructing the instance. The ServiceCollection cannot guarantee you won't ask for a service that doesn't exist, but it can guarantee any service it knows about can be correctly resolved. The ServiceCollection is ultimately a factory and can create multiple, independent ServiceProvider instances if you want. For binary applications, most users will only add descriptors to the ServiceCollection . The ServiceCollection becomes much more useful in library crates and test applications. Here is a summary of the most useful functions: Function Description add Adds a new item try_add Attempts to add a new item if the same service is unregistered try_add_to_all Attempts to add a new item to a set if it's unregistered try_add_all Adds a sequence of new items replace Adds a new item or replaces an existing registration try_replace Equivalent to try_add Best Practice To make it easy to test a binary application, it is recommended that you expose a public function that configures the default set of services. This will make it simple to use the same default configuration as the application and replace only the parts that are necessary for testing. use di::*; #[injectable]
