pub struct Thing2; impl Thing for Thing2; impl ToString for Thing2 { fn to_string(&self) -> String { String::from(std::any::type_name::<Self>()) }
} #[injectable]
pub struct CatInTheHat { pub thing1: Ref<dyn Thing>, pub thing2: Ref<dyn Thing>,
} CatInTheHat has two different dependencies of dyn Thing, but they are not expected to be same implementation. One solution would be to simply use Thing1 and Thing2 directly. Another solution would be to have complementary dyn Thing1 and dyn Thing2 traits. The final approach would be to used keyed services. A keyed service allows a service to be resolved in conjunction with a key. In many dependency injection frameworks, keyed services are supported by using a String as the key. That approach has a number of different problems. The more-di crate uses a type as a key instead. This approach provides the following advantages: No magic strings No attributes or other required metadata No hidden service location lookups No name collisions (because types are unique) No changes to ServiceDescriptor In the previous code example there is nothing in place that restricts or defines which dyn Thing needs to be mapped. By definition, any dyn Thing could be used, but a specific mapping is expected. To address that, we can refactor to use a KeyedRef. We also need to define some keys . A key is just a type used as a marker. A zero-sized struct is perfect for this case. For all intents and purposes, this struct acts like an enumeration. A key difference is that the required value is defined as part of the requested type, which an enumeration cannot do. Let's perform a little refactoring: use crate::*;
use di::*; pub mod key { pub struct Thing1; pub struct Thing2;
} #[injectable]
pub struct CatInTheHat { pub thing1: KeyedRef<key::Thing1, dyn Thing>, pub thing2: KeyedRef<key::Thing2, dyn Thing>,
} Introducing a key means that we can no longer provide just any dyn Thing; a specific registration must be mapped. Although it is still possible to configure the wrong key, the key specified will never collide with a key defined by another crate. The compiler will enforce the key specified exists and the configuration will be validated when the ServiceProvider is created. Key types do not be need to be public or in nested modules unless you want them to be. It's important to know that we only need the key at the injection call site. We can safely convert down to Ref if we use an injected constructor as follows: use crate::*;
