} The Needy struct defines a Lazy that wraps around a service dependency. This allows the service to be evaluated on-demand and also keeps the Expensive struct visible as a required collaborator. Despite being a generic type, Lazy can only be created using the utility functions from the lazy module as follows: Function Resolution lazy::exactly_one A required service lazily lazy::exactly_one_mut A required, mutable service lazily lazy::exactly_one_with_key A required service with a key lazily lazy::exactly_one_with_key_mut A required, mutable service with key lazily lazy::zero_or_one An optional service lazily lazy::zero_or_one_mut An optional, mutable service lazily lazy::zero_or_one_by_key An optional, service with a key lazily lazy::zero_or_one_by_key_mut An optional, mutable service with a key lazily lazy::zero_or_more One or more services lazily lazy::zero_or_more_mut One or more mutable services lazily lazy::zero_or_more_by_key One or more services with a key lazily lazy::zero_or_more_by_key_mut One or more mutable services with a key lazily lazy::missing Always resolves None lazy::missing_with_key Always resolves None lazy::empty Always resolves Vec::with_capacity(0) lazy::empty_with_key Always resolves Vec::with_capacity(0) lazy::init Initializes from an instance (ex: testing) lazy::init_mut Initializes from a mutable instance (ex: testing) lazy::init_by_key Initializes from a keyed instance (ex: testing) lazy::init_by_key_mut Initializes from a mutable, keyed instance (ex: testing) Lazy is a special type which cannot be resolved directly from a ServiceProvider . You will need construct one or more Lazy registrations in the activation factory method. For example: use crate::*;
