A Singleton is created exactly once and lives for the lifetime of the root ServiceProvider no matter where it is actually first instantiated. A Singleton in the root scope will be the same as a Singleton created in a nested scope. use crate::*;
use di::*; let provider = ServiceCollection::new() .add(Bar::transient()) .add(Foo::singleton()) .build_provider() .unwrap(); let foo1 = provider.get_required::<Foo>(); { let scope = provider.create_scope(); let foo2 = scope.get_required::<Foo>(); assert!(Ref::ptr_eq(&foo1, &foo2));
} In addition, if a Singleton is first created in a nested scoped, it will still be the same instance in the root scope. use crate::*;
use di::*; let provider = ServiceCollection::new() .add(Bar::transient()) .add(Foo::singleton()) .build_provider() .unwrap();
let foo1; { let scope = provider.create_scope(); foo1 = scope.get_required::<Foo>();
} let foo2 = provider.get_required::<Foo>();
assert!(Ref::ptr_eq(&foo1, &foo2));
